/**
 * Global prefix for site url when hosted somewhere other than root of domain
 * If hosted at site.com/blog/, this would return /blog/
 * Set in gatsby-config.js pathPrefix
 * https://www.gatsbyjs.org/docs/path-prefix/
 */
declare var __PATH_PREFIX__: string;
declare module '*.png';
declare module '*.jpg';
declare module '*.svg';
